Naughty Nurses
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Description: There's something about this feature that makes me think I've seen this before. Is it the music score? No, that's just a derivative of some of the pop hits I hear on the radio nowadays. Could it be the sex? Maybe After all, there's only so many ways to &quot;do it&quot;, and the way it's done here can be seen just about anywhere.
But wait a minute! I know what it is! It's Harry Reems as a comical doctor, who cures a girl's (Robin Cannes) sexual problems after he discovers her clitoris is in her throat. Sound familiar to you? And he even makes a reference to that famous film of about 12 years ago (and that girl &quot;Linda something or other&quot;), where just like with Cannes &quot;deep throat&quot; saved the day.
The folks at Video Exclusives, who have in the past put out excellent features (Star 85, Summer Break, etc.), seem desperate with this misleading effort. Sex scenes an spliced together with &quot;flash cards&quot; saying who'll be doing what to whom, and Bunny Bleu, in one brief scene, is the only actress to actually wear a nurses uniform. Stacey Donovan, the alleged other &quot;nurse&quot;, I don't think says more than three words during her two brief stints on screen.
The sex scenes themselves, and the entire video as a whole seem drawn out. I wouldn't mind waiting if the action was hot, but in Naughty Nurses it isn't too good.

